import React, {Component} from 'react'
import ReactDOM from 'react-dom'

class Message extends Component {
    render() {
        return (
            <div>
                <h1>{this.props.abc}</h1>
            </div>
        )
    }
}

ReactDOM.render(
    <Message abc="Hey Yo!" />,
  document.getElementById('root')
)
